            <div>
            <img src={process.env.PUBLIC_URL + '/medussa.jpg'}></img>
            <img src={process.env.PUBLIC_URL + '/medussa.jpg'}></img>
            <img src={process.env.PUBLIC_URL + '/medussa.jpg'}></img>
            </div>
        </div>
    );
};

export default Projects;
